INSERT INTO `event_details` (`EventID`, `EventName`, `EventDate`, `EventTime`, `EventCategory`, `EventDescription`, `EventTicketPrice`, `EventTicketTotal`, `EventTicketSold`, `VenueID`, `UserID`, `img_link`) VALUES
(1, 'Coding Competition', '2024-01-05', '02:00:00', 'Study', 'Coding competitions are aimed at testing your coding skills. They help in developing problem solving skills, cognitive functioning, logical thinking, and programming skills', 5, 50000, 2, 1, '2HN22CS402', '[imagedance.jpg]'),
(2, 'Technical Quiz', '2024-01-12', '02:00:00', 'Quiz', 'A technical quiz is a type of quiz that focuses on testing knowledge and understanding of technical subjects, such as science, technology and engineering fields. It may include questions related to concepts, theories and problem-solving techniques', 16, 300, 2, 1, '2HN22CS404', '[imagedance.jpg]'),
(3, 'Cooking without fire', '2024-01-19', '02:00:00', 'Off stage ', 'No-fire cooking, also known as flameless cooking, is a method of preparing food without using any heat source. This can be done using a variety of techniques, such as marinating, curing, pickling, and fermenting.', 50, 1000, 2, 3, '2HN21CS012', '[imagedance.jpg]'),
(4, 'Rangoli', '2023-12-08', '02:00:00', 'Off stage event', 'Rangoli is an art form that originates from the Indian subcontinent, in which patterns are created on the floor or a tabletop using materials such as powdered lime stone, red ochre, dry rice flour, coloured sand, quartz powder, flower petals, and coloured rocks.', 12, 50000, 1, 3, '2HN22CS401', '[imagedance.jpg]'),
(5, 'Carrom', '2023-12-15', '02:00:00', 'Indoor Game', 'Carrom is a tabletop game of Indian origin in which players flick discs, attempting to knock them to the corners of the board. The game is very popular in the Indian subcontinent, and is known by various names in different languages.', 150, 15000, 5, 2, '2HN22CS404', '[imagedance.jpg]'),
(7, 'PUBG', '2024-02-02', '21:30:00', 'Gaming', 'PUBG: BATTLEGROUNDS is a battle royale that pits 100 players against each other. Players will land, loot, and survive in a shrinking battleground as they outplay their opponents to become the lone survivor.', 16, 200, 3, 3, '2HN21CS005', '[imagedance.jpg]'),
(9, 'Singing', '2024-02-16', '02:30:00', 'On stage', 'Singing is the act of creating musical sounds with the voice. A person whose profession is singing is called a singer, artist or vocalist (in jazz and/or popular music). Singers perform music (arias, recitatives, songs, etc.) that can be sung with or without accompaniment by musical instruments.', 0, 10000, 3, 3, '2HN21CS012', '[imagedance.jpg]'),
(10, 'Chess', '2023-12-15', '02:00:00', 'Indoor Game', 'Chess is one of the oldest and most popular board games. It is played by two opponents on a checkered board with specially designed pieces of contrasting colours, commonly white and black. The objective of the game is to capture the opponent\'s king.', 150, 15000, 5, 2, '2HN21CS012', '[imagedance.jpg]');

